(2, 2, 'aboutus', 0, 1, 1620131557, 1620131557, '{\"sectionproperties\":{\"container\":\"1\",\"ptop\":\"25\",\"pright\":\"25\",\"pbottom\":\"25\",\"pleft\":\"25\",\"bgfixed\":\"0\",\"itemid\":0,\"bgopacity\":\"0\",\"bgcolor\":\"#ffffff\",\"shadowless\":\"1\",\"shadowcolor\":\"#cccccc\",\"customcss\":\"\",\"imageurl\":\"\"},\"title\":{\"text\":\"About us\",\"fontsize\":\"30\",\"color\":\"#555555\"},\"description\":{\"text\":\"Committee of Colleges of Health Sciences and Technology of Nigeria was established to foster unity among the Colleges of Health Sciences and Technology of Nigeria.\",\"fontsize\":\"16\",\"color\":\"#908b8b\"},\"btnlink\":\"\",\"btnlabel\":\"Click Here\",\"cardradius\":\"0\",\"image\":0,\"view\":\"1\",\"block\":[{\"title\":{\"text\":\"E-LEARNING PLATFORM\",\"color\":\"#555555\"},\"description\":{\"text\":\"\",\"color\":\"#908b8b\"},\"icon\":\"fa fa-paint-brush\",\"color\":\"#22be83\",\"btnlink\":\"\",\"btnlabel\":{\"text\":\"\",\"color\":\"#000000\"},\"border\":\"1\",\"blockbackground\":\"1\",\"image\":0,\"imageurl\":\"\"},{\"title\":{\"text\":\"LEARN AT YOUR PACE\",\"color\":\"#555555\"},\"description\":{\"text\":\"\",\"color\":\"#908b8b\"},\"icon\":\"fa fa-umbrella\",\"color\":\"#56bc29\",\"btnlink\":\"\",\"btnlabel\":{\"text\":\"\",\"color\":\"#000000\"},\"border\":\"1\",\"blockbackground\":\"1\",\"image\":0,\"imageurl\":\"\"},{\"title\":{\"text\":\"SOCIAL CAPABILITY\",\"color\":\"#555555\"},\"description\":{\"text\":\"\",\"color\":\"#908b8b\"},\"icon\":\"fa fa-envira\",\"color\":\"#3cfbf8\",\"btnlink\":\"\",\"btnlabel\":{\"text\":\"\",\"color\":\"#000000\"},\"border\":\"1\",\"blockbackground\":\"1\",\"image\":0,\"imageurl\":\"\"},{\"title\":{\"text\":\"TESTED AND TRUSTED\",\"color\":\"#555555\"},\"description\":{\"text\":\"\",\"color\":\"#908b8b\"},\"icon\":\"fa fa-magic\",\"color\":\"#e38ec2\",\"btnlink\":\"\",\"btnlabel\":{\"text\":\"\",\"color\":\"#000000\"},\"border\":\"1\",\"blockbackground\":\"1\",\"image\":0,\"imageurl\":\"\"}],\"image